import React from "react";
import './experience.css'; 

const Experience = () => {
    return (
        <div className="">
            <div className="job">
                <div className="jobInfo">
                    <h5>{"Limbitless Solutions"}</h5>
                    <p>{"01/2023 - 05/2023"}</p>
                </div>
                <p>{"Slayed"}</p>
            </div>
            <div className="job">
                <div className="jobInfo">
                    <h5>{"Undergraduate Teaching Assistant"}</h5>
                    <p>{"08/2023 - Present"}</p>
                </div>
                <p>{"Slayedpt 2"}</p>
            </div>
        </div>
    )
}

export default Experience;
